源参与同类竞品，如有想法可联系团队xiaonuobase@qq.com商议合作。\\n * 6.若您的项目无法满足以上几点，需要更多功能代码，获取Snowy商业授权许可，请在官网购买授权，地址为 https://www.xiaonuo.vip\\n */\\npackage vip.xiaonuo.biz.modular.log.service;\\n\\nimport com.baomidou.mybatisplus.extension.plugins.pagination.Page;\\nimport com.baomidou.mybatisplus.extension.service.IService;\\nimport vip.xiaonuo.biz.modular.log.entity.DevLog;\\nimport vip.xiaonuo.biz.modular.log.param.DevLogAddParam;\\nimport vip.xiaonuo.biz.modular.log.param.DevLogEditParam;\\nimport vip.xiaonuo.biz.modular.log.param.DevLogIdParam;\\nimport vip.xiaonuo.biz.modular.log.param.DevLogPageParam;\\n\\nimport java.util.List;\\n\\n/**\\n * 日志Service接口\\n *\\n * @author scx\\n * @date  2023/09/22 06:34\\n **/\\npublic interface DevLogService extends IService<DevLog> {\\n\\n    /**\\n     * 获取日志分页\\n     *\\n     * @author scx\\n     * @date  2023/09/22 06:34\\n     */\\n    Page<DevLog> page(DevLogPageParam devLogPageParam);\\n\\n    /**\\n     * 添加日志\\n     *\\n     * @author scx\\n     * @date  2023/09/22 06:34\\n     */\\n    void add(DevLogAddParam devLogAddParam);\\n\\n    /**\\n     * 编辑日志\\n     *\\n     * @author scx\\n     * @date  2023/09/22 06:34\\n     */\\n    void edit(DevLogEditParam devLogEditParam);\\n\\n    /**\\n     * 删除日志\\n     *\\n     * @author scx\\n     * @date  2023/09/22 06:34\\n     */\\n    void delete(List<DevLogIdParam> devLogIdParamList);\\n\\n    /**\\n     * 获取日志详情\\n     *\\n     * @author scx\\n     * @date  2023/09/22 06:34\\n     */\\n    DevLog detail(DevLogIdParam devLogIdParam);\\n\\n    /**\\n     * 获取日志详情\\n     *\\n     * @author scx\\n     * @date  2023/09/22 06:34\\n     **/\\n    DevLog queryEntity(String id);\\n}\\n\"},{\"codeFileName\":\"DevLogServiceImpl.java\",\"codeFileWithPathName\":\"vip/xiaonuo/biz/modular/log/service/impl/DevLogServiceImpl.java\",\"codeFileContent\":\"/*\\n * Copyright [2022] [https://www.xiaonuo.vip]\\n *\\n * Snowy采用APACHE LICENSE 2.0开源协议，您在使用过程中，需要注意以下几点：\\n *\\n * 1.请不要删除和修改根目录下的LICENSE文件。\\n * 2.请不要删除和修改Snowy源码头部的版权声明。\\n * 3.本项目代码可免费商业使用，商业使用请保留源码和相关描述文件的项目出处，作者声明等。\\n * 4.分发源码时候，请注明软件出处 https://www.xiaonuo.vip\\n * 5.不可二次分发开源参与同类竞品，如有想法可联系团队xiaonuobase@qq.com商议合作。\\n * 6.若您的项目无法满足以上几点，需要更多功能代码，获取Snowy商业授权许可，请在官网购买授权，地址为 https://www.xiaonuo.vip\\n */\\npackage vip.xiaonuo.biz.modular.log.service.impl;\\n\\nimport cn.hutool.core.bean.BeanUtil;\\nimport cn.hutool.core.collection.CollStreamUtil;\\nimport cn.hutool.core.util.ObjectUtil;\\nimport cn.hutool.core.util.StrUtil;\\nimport com.baomidou.mybatisplus.core.conditions.query.QueryWrapper;\\nimport com.baomidou.mybatisplus.extension.plugins.pagination.Page;\\nimport com.baomidou.mybatisplus.extension.service.impl.ServiceImpl;\\nimport org.springframework.stereotype.Service;\\nimport org.springframework.transaction.annotation.Transactional;\\nimport vip.xiaonuo.common.enums.CommonSortOrderEnum;\\nimport vip.xiaonuo.common.exception.CommonException;\\nimport vip.xiaonuo.common.page.CommonPageRequest;\\nimport vip.xiaonuo.biz.modular.log.entity.DevLog;\\nimport vip.xiaonuo.biz.modular.log.mapper.DevLogMapper;\\nimport vip.xiaonuo.biz.modular.log.param.DevLogAddParam;\\nimport vip.xiaonuo.biz.modular.log.param.DevLogEditParam;\\nimport vip.xiaonuo.biz.modular.log.param.DevLogIdParam;\\nimport vip.xiaonuo.biz.modular.log.param.DevLogPageParam;\\nimport vip.xiaonuo.biz.modular.log.service.DevLogService;\\n\\nimport java.util.List;\\n\\n/**\\n * 日志Service接口实现类\\n *\\n * @author scx\\n * @date  2023/09/22 06:34\\n **/\\n@Service\\npublic class DevLogServiceImpl extends ServiceImpl<DevLogMapper, DevLog> implements DevLogService {\\n\\n    @Override\\n    public Page<DevLog> page(DevLogPageParam devLogPageParam) {\\n        QueryWrapper<DevLog> queryWrapper = new QueryWrapper<>();\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getCategory())) {\\n            queryWrapper.lambda().like(DevLog::getCategory, devLogPageParam.getCategory());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getName())) {\\n            queryWrapper.lambda().like(DevLog::getName, devLogPageParam.getName());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getExeStatus())) {\\n            queryWrapper.lambda().like(DevLog::getExeStatus, devLogPageParam.getExeStatus());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getExeMessage())) {\\n            queryWrapper.lambda().like(DevLog::getExeMessage, devLogPageParam.getExeMessage());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getOpIp())) {\\n            queryWrapper.lambda().like(DevLog::getOpIp, devLogPageParam.getOpIp());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getOpAddress())) {\\n            queryWrapper.lambda().like(DevLog::getOpAddress, devLogPageParam.getOpAddress());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getOpBrowser())) {\\n            queryWrapper.lambda().like(DevLog::getOpBrowser, devLogPageParam.getOpBrowser());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getOpOs())) {\\n            queryWrapper.lambda().like(DevLog::getOpOs, devLogPageParam.getOpOs());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getClassName())) {\\n            queryWrapper.lambda().like(DevLog::getClassName, devLogPageParam.getClassName());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getMethodName())) {\\n            queryWrapper.lambda().like(DevLog::getMethodName, devLogPageParam.getMethodName());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getReqMethod())) {\\n            queryWrapper.lambda().like(DevLog::getReqMethod, devLogPageParam.getReqMethod());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getReqUrl())) {\\n            queryWrapper.lambda().like(DevLog::getReqUrl, devLogPageParam.getReqUrl());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getParamJson())) {\\n            queryWrapper.lambda().like(DevLog::getParamJson, devLogPageParam.getParamJson());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getResultJson())) {\\n            queryWrapper.lambda().like(DevLog::getResultJson, devLogPageParam.getResultJson());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getStartOpTime()) && ObjectUtil.isNotEmpty(devLogPageParam.getEndOpTime())) {\\n            queryWrapper.lambda().between(DevLog::getOpTime, devLogPageParam.getStartOpTime(), devLogPageParam.getEndOpTime());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getOpUser())) {\\n            queryWrapper.lambda().like(DevLog::getOpUser, devLogPageParam.getOpUser());\\n        }\\n        if(ObjectUtil.isNotEmpty(devLogPageParam.getSignData())) {\\n            queryWrapper.lambda().like(DevLog::getSignData, devLogPageParam.getSignData());\\n        }\\n        if(ObjectUtil.isAllNotEmpty(devLogPageParam.getSortField(), devLogPageParam.getSortOrder())) {\\n            CommonSortOrderEnum.validate(devLogPageParam.getSortOrder());\\n            queryWrapper.orderBy(true, devLogPageParam.getSortOrder().equals(CommonSortOrderEnum.ASC.getValue()),\\n                    StrUtil.toUnderlineCase(devLogPageParam.getSortField()));\\n        } else {\\n            queryWrapper.lambda().orderByAsc(DevLog::getId);\\n        }\\n        return this.page(CommonPageRequest.defaultPage(), queryWrapper);\\n    }\\n\\n    @Transactional(rollbackFor = Exception.class)\\n    @Override\\n    public void add(DevLogAddParam devLogAddParam) {\\n        DevLog devLog = BeanUtil.toBean(devLogAddParam, DevLog.class);\\n        this.save(devLog);\\n    }\\n\\n    @Transactional(rollbackFor = Exception.class)\\n    @Override\\n    public void edit(DevLogEditParam devLogEditParam) {\\n        DevLog devLog = this.queryEntity(devLogEditParam.getId());\\n        BeanUtil.copyProperties(devLogEditParam, devLog);\\n        this.updateById(devLog);\\n    }\\n\\n    @Transactional(rollbackFor = Exception.class)\\n    @Override\\n    public void delete(List<DevLogIdParam> devLogIdParamList) {\\n        // 执行删除\\n        this.removeByIds(CollStreamUtil.toList(devLogIdParamList, DevLogIdParam::getId));\\n    }\\n\\n    @Override\\n    public DevLog detail(DevLogIdParam devLogIdParam) {\\n        return this.queryEntity(devLogIdParam.getId());\\n    }\\n\\n    @Override\\n    public DevLog queryEntity(String id) {\\n        DevLog devLog = this.getById(id);\\n        if(ObjectUtil.isEmpty(devLog)) {\\n            throw new CommonException(\\\"日志不存在，id值为：{}\\\", id);\\n        }\\n        return devLog;\\n    }\\n}\\n\"}]}}', '2023-09-22 06:34:21', '超管', '9192c4dc9c7a2cddfaf40496f96faf03ac8a960ed18ee434a4ef792a08e422db7bb11ce4ae0ad2b7efa2c67246a741f67b332df1922824d536630613fc90926d', '2023-09-22 06:34:21', '1543837863788879871', NULL, NULL);
